INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (16, 8, 0, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "獣人族", "人助け、応援", 44, 2, "ヒヨリ", "人助けが大好き！　前向き格闘娘", "A", "トゥインクルウィッシュ", 155, "東山奈央", 100101, 27);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (17, 4, 0, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "ヒューマン", "料理、人間観察", 47, 2, "ユイ", "戦闘のサポートが得意な、心優しい少女", "O", "トゥインクルウィッシュ", 158, "種田梨沙", 100201, 5);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (18, 1, 0, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "魔族", "読書、乗馬、お茶", 46, 2, "レイ", "クールで何事にも真っ直ぐな剣士", "B", "トゥインクルウィッシュ", 163, "早見沙織", 100301, 12);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (9, 8, 0, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "ヒューマン", "いたずら、探検", 27, 5, "ミソギ", "探検好きのイタズラっ子", "O", "リトルリリカル", 128, "諸星すみれ", 100401, 10);
