INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (13, 11, 0, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", "魔族", "サックス", 42, 7, "アカリ", "甘え上手なみんなの人気者", "O", "悪魔偽王国軍（ディアボロス）", 150, "浅倉杏美", 100601, 22);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (14, 1, 0, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "魔族", "プリンを食べること", 32, 7, "ミヤコ", "プリン大好きゴースト娘", "B", "悪魔偽王国軍（ディアボロス）", 130, "雨宮天", 100701, 23);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (14, 10, 0, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "エルフ", "鏡で自分を見ること", 40, 15, "ユキ", "ボクは誰よりも美しい", "AB", "ヴァイスフリューゲル　ランドソル支部", 150, "大空直美", 100801, 10);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (17, 7, 0, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "魔族", "小説執筆", 45, 13, "アンナ", "前世を信じる中二病患者、「疾風の冥姫」", "A", "トワイライトキャラバン", 159, "髙野麻美", 100901, 5);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (16, 9, 0, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "獣人族", "空想、ぬいぐるみ集め", 42, 10, "マホ", "マホマホ王国のプリンセス", "O", "自警団（カォン）", 155, "内田真礼", 101001, 22);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (15, 8, 0, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "ヒューマン", "お裁縫", 44, 3, "リノ", "人懐っこくてマシンガントークな妹系少女", "A", "ラビリンス", 156, "阿澄佳奈", 101101, 25);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (17, 12, 0, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "エルフ", "妹と遊ぶこと、二度寝、昼寝、早寝", 46, 6, "ハツネ", "みんなのために超能力を使う眠り姫", "A", "フォレスティエ", 156, "大橋彩香", 101201, 24);
