INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (21, 9, 0, "test", "エルフ", "絵本作り", 54, 6, "ミサト", "母性溢れる優しいみんなの「ミサト先生」", "O", "フォレスティエ", 165, "國府田マリ子", 101501, 5);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (18, 4, 0, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "魔族", "ファッション", 48, 14, "スズナ", "天真爛漫で人気者のカリスマモデル", "O", "ルーセント学院", 167, "上坂すみれ", 101601, 10);
