INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (23, 8, 0, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "魔族", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 52, 14, "イオ", "多くの男性を魅了する無垢な女教師", "B", "ルーセント学院", 162, "伊藤静", 101801, 14);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (10, 4, 0, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "獣人族", "かわいいもの集め", 21, 5, "ミミ", "お歌もにんじんも、ウサギさんも大好き♪", "O", "リトルリリカル", 117, "日高里菜", 102001, 3);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (12, 6, 0, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "ヒューマン", "観劇、おままごと", 40, 9, "クルミ", "泣き虫で臆病な守ってあげたい女の子", "B", "サレンディア救護院", 150, "植田佳奈", 102101, 9);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (13, 11, 0, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "魔族", "ゲーム全般", 40, 7, "ヨリ", "人見知りであまのじゃくな女の子", "O", "悪魔偽王国軍（ディアボロス）", 150, "原紗友里", 102201, 22);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (14, 5, 0, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "ヒューマン", "屋内でできる遊び", 38, 9, "アヤネ", "ぷうきちといつも一緒！", "B", "サレンディア救護院", 148, "芹澤優", 102301, 10);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (15, 12, 0, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "ヒューマン", "ご奉仕", 43, 9, "スズメ", "お嬢さまのためにがんばるドジっ娘メイド", "O", "サレンディア救護院", 154, "悠木碧", 102501, 12);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (17, 1, 0, "test", "獣人族", "あんパン", 42, 11, "リン", "遊びと睡眠が何より大事なぐうたら娘", "B", "牧場（エリザベスパーク）", 144, "小岩井ことり", 102601, 1);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (16, 7, 0, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "魔族", "実験、裁縫、料理", 43, 13, "エリコ", "運命の相手に一途すぎる乙女", "B", "トワイライトキャラバン", 154, "橋本ちなみ", 102701, 30);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (17, 10, 0, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "エルフ", "経営、お茶会", 43, 9, "サレン", "救護院を経営する優しい庶民派お嬢様", "A", "サレンディア救護院", 156, "堀江由衣", 102801, 4);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (17, 1, 0, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", "ヒューマン", "舞台鑑賞、ダンス", 40, 4, "ノゾミ", "歌って踊れる大人気アイドル", "B", "カルミナ", 157, "日笠陽子", 102901, 24);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (16, 8, 0, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "ヒューマン", "忍法開発", 51, 15, "ニノン", "トーゴクの神秘、オシエテクダサイ！", "O", "ヴァイスフリューゲル　ランドソル支部", 163, "佐藤聡美", 103001, 31);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (18, 12, 0, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "魔族", "占い", 42, 7, "シノブ", "占いが得意な霊能少女", "AB", "悪魔偽王国軍（ディアボロス）", 157, "大坪由佳", 103101, 22);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (18, 3, 0, "この私とともにいる限り、\nお金に不自由はさせませんわ！", "ヒューマン", "慈善事業", 45, 12, "アキノ", "一人前の商人を目指すパワフルお嬢様", "AB", "メルクリウス財団", 157, "松嵜麗", 103201, 12);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (20, 3, 0, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "ヒューマン", "漫才", 35, 11, "マヒル", "みんなを笑顔にするお笑い牧場主", "B", "牧場（エリザベスパーク）", 142, "新田恵海", 103301, 3);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (22, 3, 0, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", "エルフ", "ウインドーショッピング", 55, 12, "ユカリ", "純情でほっとけない大人の女性", "A", "メルクリウス財団", 164, "今井麻美", 103401, 16);
