INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (13, 8, 0, "test", "ヒューマン", "剣術、年長者をからかう", 43, 8, "トモ", "義理堅くてからかい好きな剣術少女", "A", "王宮騎士団（NIGHTMARE）", 149, "茅原実里", 103701, 11);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (14, 11, 0, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", "獣人族", "読書、お散歩", 40, 11, "シオリ", "読書が趣味の病弱少女", "A", "牧場（エリザベスパーク）", 153, "小清水亜美", 103801, 3);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (13, 6, 0, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", "エルフ", "友達作りのイメトレ", 44, 6, "アオイ", "「友達」に憧れる、エルフの森の女の子", "AB", "フォレスティエ", 158, "花澤香菜", 104001, 6);
