INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (17, 8, 0, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "獣人族", "お菓子作り", 54, 10, "マコト", "男勝りで情に厚いワイルド娘", "O", "自警団（カォン）", 168, "小松未可子", 104301, 9);
