INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (18, 11, 0, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "ヒューマン", "小説を読むこと", 49, 15, "クウカ", "妄想大好き！　ほんとは照れ屋な女の子", "AB", "ヴァイスフリューゲル　ランドソル支部", 157, "長妻樹里", 104501, 19);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (18, 3, 0, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "獣人族", "猫とたわむれること", 48, 12, "タマキ", "弱きを助け強きをくじく猫娘", "AB", "メルクリウス財団", 158, "沼倉愛美", 104601, 1);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (25, 10, 0, "？？？", "ヒューマン", "格闘技、湯浴み", 50, 8, "ジュン", "素顔を見せない冷静沈着な女性騎士", "A", "王宮騎士団（NIGHTMARE）", 171, "川澄綾子", 104701, 25);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (20, 11, 0, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "ヒューマン", "傭兵などのアルバイト", 49, 12, "ミフユ", "仕事も私事も効率優先な傭兵少女", "O", "メルクリウス財団", 163, "田所あずさ", 104801, 11);
