INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (15, 12, 0, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "ヒューマン", "ご奉仕", 43, 9, "スズメ（サマー）", "お嬢さまのためにがんばるドジっ娘メイド", "O", "サレンディア救護院", 154, "悠木碧", 107701, 12);
