INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (18, 3, 0, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "獣人族", "猫とたわむれること", 48, 12, "タマキ（サマー）", "弱きを助け強きをくじく猫娘", "AB", "メルクリウス財団", 158, "沼倉愛美", 107901, 1);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (20, 11, 0, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "ヒューマン", "傭兵などのアルバイト", 49, 12, "ミフユ（サマー）", "仕事も私事も効率優先な傭兵少女", "O", "メルクリウス財団", 163, "田所あずさ", 108001, 11);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (18, 12, 0, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "魔族", "占い", 42, 7, "シノブ（ハロウィン）", "占いが得意な霊能少女", "AB", "悪魔偽王国軍（ディアボロス）", 157, "大坪由佳", 108101, 22);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (14, 1, 0, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "魔族", "プリンを食べること", 32, 7, "ミヤコ（ハロウィン）", "プリン大好きゴースト娘", "B", "悪魔偽王国軍（ディアボロス）", 130, "雨宮天", 108201, 23);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (11, 1, 0, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "魔族", "ファッション誌鑑賞、コスメ集め", 22, 14, "ミサキ（ハロウィン）", "ちょっとおませな恋に恋する女の子", "A", "ルーセント学院", 120, "久野美咲", 108301, 3);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (17, 6, 0, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "ヒューマン", "各種楽器", 46, 4, "チカ（クリスマス）", "人々を守るために歌う、唱喚士の少女", "O", "カルミナ", 163, "福原綾香", 108401, 3);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (12, 6, 0, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "ヒューマン", "観劇、おままごと", 40, 9, "クルミ（クリスマス）", "泣き虫で臆病な守ってあげたい女の子", "B", "サレンディア救護院", 150, "植田佳奈", 108501, 9);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (14, 5, 0, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "ヒューマン", "屋内でできる遊び", 38, 9, "アヤネ（クリスマス）", "ぷうきちといつも一緒！", "B", "サレンディア救護院", 148, "芹澤優", 108601, 10);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (16, 8, 0, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "獣人族", "人助け、応援", 44, 2, "ヒヨリ（ニューイヤー）", "人助けが大好き！　前向き格闘娘", "A", "トゥインクルウィッシュ", 155, "東山奈央", 108701, 27);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (17, 4, 0, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "ヒューマン", "料理、人間観察", 47, 2, "ユイ（ニューイヤー）", "戦闘のサポートが得意な、心優しい少女", "O", "トゥインクルウィッシュ", 158, "種田梨沙", 108801, 5);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (18, 1, 0, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "魔族", "読書、乗馬、お茶", 46, 2, "レイ（ニューイヤー）", "クールで何事にも真っ直ぐな剣士", "B", "トゥインクルウィッシュ", 163, "早見沙織", 108901, 12);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (16, 7, 0, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "魔族", "実験、裁縫、料理", 43, 13, "エリコ（バレンタイン）", "運命の相手に一途すぎる乙女", "B", "トワイライトキャラバン", 154, "橋本ちなみ", 109001, 30);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (18, 10, 0, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "ヒューマン", "家事全般", 54, 3, "シズル（バレンタイン）", "お姉ちゃんがお世話してあげるからねっ！", "O", "ラビリンス", 168, "生天目仁美", 109101, 24);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (17, 12, 0, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", "ヒューマン", "読書", 55, "", "アン", "英霊と契約を結んだマナリアの天才王女", "AB", "？？？", 156, "日笠陽子", 109201, 1);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (15, 2, 0, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", "ヒューマン", "食べること、眠ること", 45, "", "ルゥ", "マナリア魔法学院の新入生", "O", "？？？", 144, "こやまきみこ", 109301, 4);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (17, 11, 0, "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", "半人半竜", "ピアノ", 67, "", "グレア", "人を超越した力を有す心優しい竜姫", "B", "？？？", 167, "福原綾香", 109401, 3);
